import {
  IoLibraryOutline,
  IoSettingsOutline,
  IoLogOutOutline,
} from "react-icons/io5";
import { CgProfile } from "react-icons/cg";

export const SidebarData = [
  {
    title: "Profile",
    path: "/library",
    icon: <CgProfile />,
    cName: "nav-text",
  },
  {
    title: "Settings",
    path: "/settings",
    icon: <IoSettingsOutline />,
    cName: "nav-text",
  },
  {
    title: "Sign out",
    path: "/login",
    icon: <IoLogOutOutline />,
    cName: "nav-text",
  },
];
